    }
    render() {


    return (
            <header>
                <div
                    className="logo"
                    onClick={ this.inputChange }
                >Logo
                </div>
                <input
                    type='text'
                    onChange={ (e) =>{
                        this.inputChange(e)
                    }
                    }
                />
            </header>
        )
    }
}

export default Header;
